export const getDoctorBySlug = (slug: string): ResolvedDoctor | null => {
  const foundIdx = doctors.findIndex((d, idx) => slugify(d.n) === slug);
  if (foundIdx === -1) return null;
  return resolveDoctor(doctors[foundIdx], foundIdx);
};
